import { AccessAlarm, ThreeDRotation } from '@mui/icons-material';
import Battery0BarIcon from '@mui/icons-material/Battery0Bar';

const CpacityBattery = (capacity, mentees_num) => {
    let full_fruction = mentees_num / capacity;
    if (full_fruction == 0) {
      return (
        <div>
          <Battery0BarTwoTone/>
          <span>Battery Level: 0%</span>
        </div>
      );
    }
    if (full_fruction <= 0.2) {
      return <Battery20/>;
    }
    if (full_fruction <= 0.4) {
      return Battery30;
    }
    if (full_fruction <= 0.5) {
      return Battery50;
    }
    if (full_fruction <= 0.6) {
      return Battery60;
    }
    if (full_fruction <= 0.8) {
      return Battery80;
    }
    if (full_fruction < 1) {
      return Battery90;
    }
    else {
      return BatteryFull;
    }
  };
  
  export default CpacityBattery;
